import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import "../Css/Navbar.css"



class Nav extends Component {
  render() {
    return (


<nav>
  <ul>
    <li>
      <Link to='/Data'>Home</Link>
    </li>
    <li>
      <a>About</a>
    </li>
    <li>
      <a>Services</a>
    </li>
    <li>
      <a>Contact</a>
    </li>
  </ul>
</nav>

    );
  }
}

export default Nav;
